import React from "react";

const Dashboard = ({ role }) => {
  return (
    <div style={{ padding: "20px" }}>
      <h2>Dashboard</h2>
      {role ? <p>Welcome, {role}!</p> : <p>Please login to continue.</p>}
    </div>
  );
};

export default Dashboard;
